import React from 'react';
import Card from "./Card"
import "./Cards.css"

const cards =[
  {
    id: 1,
    title:"Res",
    image:"./assets/res.jpg"
  },
  {
    id: 2,
    title:"pollo",
    image:"./assets/pollo.jpg"
  },
  {
    id: 3,
    title:"pollo",
    image:"./assets/cerdo.jpg"
  },
  {
    id: 4,
    title:"pollo",
    image:"./assets/pez.jpg"
  },
  {
    id: 5,
    title:"pollo",
    image:"./assets/pez.jpg"
  },

]

function Cards() {
  return (
    <div className='container d-flex card-container '>
  <div className="row">
  {
    cards.map(card => (
    <div className="col-md-6" key={card.id}>
    <Card title={card.title} image={card.image}/>

    </div>   
    ))
    }
    </div>
</div>
  )
}

export default Cards;
